import React from 'react';
import Button from '@mui/material/Button';
import Container from '@mui/material/Container';
import Box from '@mui/material/Grid';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
// import CardActions from '@mui/material/CardActions';

const Staff = () => {
  return (
<Container maxWidth="sm">
  {/* <Box sx={{ width: 800, height: 1000 }} alignItems="center" marginTop="100px"> */}
  <Box
      sx={{
        display: 'flex',
        width: 800, 
        height: 700,
        flexDirection: { xs: 'column', md: 'row' },
        alignItems: 'center',
        justifyContent: 'center',
      }}
    >
    <Grid container spacing={40} direction="row">
      <Grid item xs={12} sm={4}>
        <Button variant="contained" color="primary">
          {/* <CardActions display='flex' justifyContent='center'> */}
            <Typography variant="h4">Manager</Typography>
          {/* </CardActions>   */}
        </Button>
      </Grid>

      <Grid item xs={12} sm={4}>
        <Button variant="outlined" color="primary">
          {/* <CardActions display='flex' alignItems="center" justifyContent='center'> */}
            <Typography variant="h4">Kitchen Staff</Typography>
          {/* </CardActions> */}
        </Button>
      </Grid>

      <Grid item xs={12} sm={4}>
        <Button variant="outlined" color="primary">
            <Typography variant="h4">Wait Staff</Typography>
        </Button>
      </Grid>
    </Grid>
  </Box>
</Container>

  );
};

export default Staff;
